import React from 'react';

function NavBar() {
    return (
        <nav>
            <a href="#Header">Jesse Ren</a>
            <a href = "#About">About</a>
            <a href = "#Projects">Projects</a>
            <a href ="../Resume F2020.pdf" target="_blank">Resume</a>
            <a href = "https://github.com/jesseren" target="_blank">GitHub</a>
            <a href = "#Contact">Contact</a>
        </nav>
    )
}

export default NavBar;
